package hashmap;

import java.util.HashMap;
import java.util.Map;
import java.util.Objects;

public class ValidAnagram_242 {

    public static boolean isAnagram(String s, String t) {
        if (s.length() != t.length()){
            return false;
        }

        Map<Character,Integer> dic1 = new HashMap<>();
        Map<Character,Integer> dic2 = new HashMap<>();

        for (Character i : s.toCharArray()){
            if (dic1.containsKey(i)){
                dic1.put(i,dic1.get(i)+1);
            } else {
                dic1.put(i,1);
            }
        }

        for (Character k : t.toCharArray()){
            if (dic2.containsKey(k)){
                dic2.put(k,dic2.get(k)+1);
            } else {
                dic2.put(k,1);
            }
        }

        for (Character m : s.toCharArray()) {
            if (!dic2.containsKey(m) ||
                (!Objects.equals(dic1.get(m), dic2.get(m)))){
                return false;
            }
        }

        return true;
    }

    public static void main(String[] args) {
        String s = "";
        String t = "";
        boolean result = isAnagram(s, t);
        System.out.println(result);
    }
}
